import React from 'react';
import logo from './images/logo_est_dados_2.png';
import './App.css';

function App() {
    return ( <
        div className = "App" >
        <
        header className = "App-header" >

        <
        p className = "title" > CC4652 - ESTRUTURA DE DADOS < /p> <
        img src = { logo }
        className = "App-logo"
        alt = "logo" / >
        <
        p className = "selOpcao" >
        Selecione a estrutura desejada < /
        p >
        <
        /header> < /
        div >
    );
}

export default App;
